import './App.css';
import Customerlist from './components/Customerlist';
import Traininglist from './components/Traininglist';
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import { useState } from 'react';
import { Link, Route, Routes, BrowserRouter } from 'react-router-dom';

function App() {
  const [value, setValue] = useState('/');
  const [trainingsRefreshCount, setTrainingsRefreshCount] = useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <div className="App">
      <BrowserRouter>
        <AppBar position="static">
          <Toolbar>
            <Typography variant="h6">PERSONAL TRAINING APP</Typography>
          </Toolbar>
          </AppBar>
          <Tabs value={value} onChange={handleChange}>
            <Tab value="/" label="Customer List" component={Link} to="/"  />
            <Tab value="/traininglist" label="Training List" component={Link} to="/traininglist" />
          </Tabs>

        <Routes>
          <Route path="/" element={<Customerlist trainingsRefreshCount={trainingsRefreshCount}
      setTrainingsRefreshCount={setTrainingsRefreshCount}/>} />
          <Route path="/traininglist" element={<Traininglist refreshTrainings={trainingsRefreshCount} />} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
